import styled from "styled-components";

const media = {
  mobile: "@media(max-width:600px)",
};

const lightTheme = {
  headerBg: "#ffffff",
  logo1: "#f0912b",
  logo2: "#383838",
  searchColor: "#000000",
  searchBorder: "1px solid #383838",
  signUpBg: "#f0912b",
  signUpColor: "#ffffff",
  loginBg: "#b50000",
  loginColor: "#ffffff",
  toggleColorBefore: "#383838",
  toggleColorAfter: "#757575",
  toggleLabelColor: "#383838",
  boxShadow: "#a1a1a1",
};

const darkTheme = {
  headerBg: "#000000",
  logo1: "#0bbdab",
  logo2: "#ffffff",
  searchColor: "#000000",
  searchBorder: "1px solid #383838",
  signUpBg: "#0bbdab",
  signUpColor: "#ffffff",
  loginBg: "#757575",
  loginColor: "#ffffff",
  toggleColorBefore: "#383838",
  toggleColorAfter: "#cccccc",
  toggleLabelColor: "#ffffff",
  boxShadow: "#616161",
};

export const DashHeadWrap = styled.div`

`;
